    false,nt"url": null,nt"notes": "The data being submitted to NODC contain
    information about temperature and salinity obtained with the use of thermosalinographs
    (TSG) installed in ships of the NOAA fleet and other cargo and cruise ships. The
    data is transmitted to AOML/NOAA in real-time and submitted to a quality control
    procedure developed at AOML based on the Global Ocean Surface Underway Data Pilot
    Project (GOSUD) real-time control test. Data approved in these tests are submitted
    to the GTS. The data set submitted to NODC for distribution constitute the complete
    data set received by AOML with the corresponding flags after the quality control.",nt"owner_org":
